import CardList from './CardList'
import { robots } from './robots'
import SearchBox from './SearchBox'


class App extends Component {
  constructor(){
    super()
    this.state={
      robots: robots,
      searchfield: ''
    }
  }

  onSeachChange(event){
    console.log(event);
  }
render(){
  return (
    <div className='tc'>
      <h1>Robofriends</h1>
      <SearchBox searchChange={'onSeachChange'}/>
    <CardList robots={this.state.robots}/>
    </div>
  );
}
}

export default App;
